module.exports = "<div class=\"content\">\n  <h3>Custom route decorators</h3>\n  <p>\n    Nest is built around a language feature called <strong>decorators</strong>. It's a well-known concept in a lot of commonly\n    used programming languages, but in the JavaScript world, it's still relatively new. In order to better understand how\n    the decorators work, you should take a look at <a href=\"https://medium.com/google-developers/exploring-es7-decorators-76ecb65fb841\"\n      target=\"blank\">this</a> article. Here's a simple definition:\n  </p>\n  <blockquote class=\"external\">\n    An ES2016 decorator is an expression which returns a function and can take a target, name and property descriptor as arguments.\n    You apply it by prefixing the decorator with an <code>@</code> character and placing this at the very top of what\n    you are trying to decorate. Decorators can be defined for either a class or a property.\n  </blockquote>\n  <p>\n    Nest provides a set of useful <strong>param decorators</strong> that you can use together with the HTTP route handlers.\n    Below is a comparison of the decorators with the plain express objects.\n  </p>\n  <table>\n    <tbody>\n      <tr>\n        <td><code>@Request()</code></td>\n        <td><code>req</code></td>\n      </tr>\n      <tr>\n        <td><code>@Response()</code></td>\n        <td><code>res</code></td>\n      </tr>\n      <tr>\n        <td><code>@Next()</code></td>\n        <td><code>next</code></td>\n      </tr>\n      <tr>\n        <td><code>@Session()</code></td>\n        <td><code>req.session</code></td>\n      </tr>\n      <tr>\n        <td><code>@Param(param?: string)</code></td>\n        <td><code>req.params</code> / <code>req.params[param]</code></td>\n      </tr>\n      <tr>\n        <td><code>@Body(param?: string)</code></td>\n        <td><code>req.body</code> / <code>req.body[param]</code></td>\n      </tr>\n      <tr>\n        <td><code>@Query(param?: string)</code></td>\n        <td><code>req.query</code> / <code>req.query[param]</code></td>\n      </tr>\n      <tr>\n        <td><code>@Headers(param?: string)</code></td>\n        <td><code>req.headers</code> / <code>req.headers[param]</code></td>\n      </tr>\n    </tbody>\n  </table>\n  <p>\n    Additionally, you can create your own, <strong>custom decorator</strong>. Why it is useful?\n  </p>\n  <p>\n    In the node.js world, it's a common practice to attach properties to the <strong>request</strong> object. Then you have\n    to manually grab them every time in the route handlers, for example, using following construction:\n  </p>\n  <pre><code class=\"language-typescript\">\nconst user = req.user;</code></pre>\n  <p>\n    In order to make it more readable and transparent, we can create a <code>@User()</code> decorator and reuse it across\n    all existing controllers.\n  </p>\n  <span class=\"filename\">\n    {{ 'user.decorator' | extension: userDecoratorT.isJsActive }}\n    <app-tabs #userDecoratorT></app-tabs>\n  </span>\n  <pre><code class=\"language-typescript\">{{ userDecorator }}</code></pre>\n  <p>\n    Then, you can simply use it wherever it fits your requirements.\n  </p>\n  <span class=\"filename\">\n    <app-tabs #controllerExampleT></app-tabs>\n  </span>\n  <pre [class.hide]=\"controllerExampleT.isJsActive\"><code class=\"language-typescript\">{{ controllerExample }}</code></pre>\n  <pre [class.hide]=\"!controllerExampleT.isJsActive\"><code class=\"language-typescript\">{{ controllerExampleJs }}</code></pre>\n  <h4>Passing data</h4>\n  <p>\n    When the behavior of your decorator depends on some conditions, you may use the <code>data</code> param to pass an argument\n    to the decorator's factory function. For example, the construction below:\n  </p>\n  <span class=\"filename\">\n    <app-tabs #controllerExampleDataT></app-tabs>\n  </span>\n  <pre [class.hide]=\"controllerExampleDataT.isJsActive\"><code class=\"language-typescript\">{{ controllerExampleData }}</code></pre>\n  <pre [class.hide]=\"!controllerExampleDataT.isJsActive\"><code class=\"language-typescript\">{{ controllerExampleDataJs }}</code></pre>\n  <p>\n    Will make possible to access the <code>test</code> string via the <code>data</code> argument:\n  </p>\n  <span class=\"filename\">\n    {{ 'user.decorator' | extension: userDecoratorDataT.isJsActive }}\n    <app-tabs #userDecoratorDataT></app-tabs>\n  </span>\n  <pre><code class=\"language-typescript\">{{ userDecoratorData }}</code></pre>\n  <h4>Working with pipes</h4>\n  <p>\n    Nest treats custom param decorators in the same fashion as the built-in ones (<code>@Body()</code>, <code>@Param()</code>    and\n    <code>@Query()</code>). It means that pipes are executed for the custom annotated parameters as well (in this case, for\n    the <code>user</code> argument). Moreover, you can apply the pipe directly to the custom decorator:\n  </p>\n  <span class=\"filename\">\n    <app-tabs #pipeExampleT></app-tabs>\n  </span>\n  <pre [class.hide]=\"pipeExampleT.isJsActive\"><code class=\"language-typescript\">{{ pipeExample }}</code></pre>\n  <pre [class.hide]=\"!pipeExampleT.isJsActive\"><code class=\"language-typescript\">{{ pipeExampleJs }}</code></pre>\n</div>"

