module.exports = "<div class=\"content\">\n  <h3>Execution Context</h3>\n  <p>\n    There are several ways of mounting the Nest application. You can create either a web app, microservice or just a Nest <strong>execution\n      context</strong>. The Nest context is a wrapper around the Nest container, which holds all instantiated classes. We\n    can grab an existing instance from within any imported module directly using application object. Thanks to that, you\n    can take advantages of the Nest framework everywhere, including <strong>CRON</strong> jobs and even build a <strong>CLI</strong>\n    on top of it.\n  </p>\n  <h4>Getting started</h4>\n  <p>\n    In order to create a Nest application context, we use the following syntax:\n  </p>\n  <span class=\"filename\"><app-tabs></app-tabs></span>\n  <pre><code class=\"language-typescript\">{{ executionContext }}</code></pre>\n  <p>\n    Afterward, Nest allows you to pick any instance registered within Nest application. Let's imagine that we have a <code>TasksController</code>    in\n    the <code>TasksModule</code>. This class provides a set of usable methods, which we want to call from within CRON job.\n  </p>\n  <span class=\"filename\"><app-tabs></app-tabs></span>\n  <pre><code class=\"language-typescript\">{{ pickTasksController }}</code></pre>\n  <p>\n    And that's it. To grab <code>TasksController</code> instance we had to use <code>get()</code> method. We didn't have\n    to go through entire modules tree, the <code>get()</code> method act like a <strong>query</strong> that search for an\n    instance in each registered module automatically. However, if you prefer a strict context checking, you can always switch\n    to it using <code>strict: true</code> options object that has to be passed as the second argument of <code>get()</code>    method.\n    Then, you have to go through all modules to pick up a particular instance from the selected context.\n  </p>\n  <span class=\"filename\"><app-tabs></app-tabs></span>\n  <pre><code class=\"language-typescript\">{{ pickTasksControllerStrict }}</code></pre>\n  <table>\n    <tr>\n      <td>\n        <code>get()</code>\n      </td>\n      <td>\n        Retrieves an instance of either controller or provider (including guards, filters, and so on) available in the application\n        context.\n      </td>\n    </tr>\n    <tr>\n      <td>\n        <code>select()</code>\n      </td>\n      <td>\n        Navigates through the module tree, for example, to pull out a specific instance from the selected module (used together with\n        enabled strict mode).\n      </td>\n    </tr>\n  </table>\n  <blockquote class=\"info\">\n    <strong>Hint</strong> The root module is selected by default. In order to select any other module, you need to go through\n    entire modules tree (step by step).\n  </blockquote>\n</div>"

