module.exports = "<div class=\"content\" #contentReference>\n  <h3 id=\"first-steps\">First steps</h3>\n  <p>\n    In this set of articles, you'll learn the\n    <strong>core fundamentals</strong> of Nest. To get familiar with the essential building-blocks of Nest applications,\n    we'll build a basic CRUD application with features that cover a lot of ground at an introductory level.\n  </p>\n  <h4 id=\"language\">Language</h4>\n  <p>\n    We're in love with\n    <a href=\"http://www.typescriptlang.org/\" target=\"blank\">TypeScript</a>, but above all - we love\n    <a href=\"https://nodejs.org/en/\" target=\"blank\">Node.js</a>. That's why Nest is compatible with both TypeScript and\n    <strong>pure JavaScript</strong>. Nest is taking advantage of latest language features, so to use a framework with simple\n    JavaScript we need a\n    <a href=\"http://babeljs.io/\" target=\"blank\">Babel</a> compiler.\n  </p>\n  <p>\n    We'll mostly use TypeScript in the examples we provide, but you can always\n    <strong>switch the code snippets</strong> to vanilla JavaScript syntax.\n  </p>\n  <h4 id=\"prerequisites\">Prerequisites</h4>\n  <p>\n    Please make sure that\n    <a href=\"https://nodejs.org/\" target=\"blank\">Node.js</a>\n    <strong>(>= 8.9.0)</strong> is installed on your operating system.\n  </p>\n  <h4 id=\"setup\">Setup</h4>\n  <p>\n    Setting up a new project is quite simple with the\n    <a routerLink=\"/cli/overview\">Nest CLI</a>. With\n    <a href=\"https://www.npmjs.com/\" target=\"blank\">npm</a> installed, you can create a new Nest project with the following\n    commands in your OS terminal:\n  </p>\n  <pre><code class=\"language-bash\">\n$ npm i -g @nestjs/cli\n$ nest new project</code></pre>\n  <p>The\n    <code>project</code> directory will be scaffolded with several core files being located within a\n    <code>src/</code> directory.\n  </p>\n  <div class=\"file-tree\">\n    <div class=\"item\">src</div>\n    <div class=\"children\">\n      <div class=\"item\">app.controller.ts</div>\n      <div class=\"item\">app.module.ts</div>\n      <div class=\"item\">main.ts</div>\n    </div>\n  </div>\n  <p>\n    Following the convention, newly created modules should have their dedicated directory.\n    <table>\n      <tr>\n        <td>\n          <code>main.ts</code>\n        </td>\n        <td>The entry file of the application. It uses\n          <code>NestFactory</code> to create the Nest application instance.</td>\n      </tr>\n      <tr>\n        <td>\n          <code>app.module.ts</code>\n        </td>\n        <td>Defines\n          <code>AppModule</code>, the root module of the application.</td>\n      </tr>\n      <tr>\n        <td>\n          <code>app.controller.ts</code>\n        </td>\n        <td>Basic controller sample with a single route.</td>\n      </tr>\n    </table>\n    <p>\n      The\n      <code>main.ts</code> includes an async function, which will\n      <strong>bootstrap</strong> our application:\n    </p>\n    <span class=\"filename\">\n      {{ 'main' | extension: bootstrapSwitch.isJsActive }}\n      <app-tabs #bootstrapSwitch></app-tabs>\n    </span>\n    <pre><code class=\"language-typescript\">{{ bootstrap }}</code></pre>\n    <p>\n      To create a Nest application instance, we are using the\n      <code>NestFactory</code>. <code>NestFactory</code> is one of the most fundamental classes, it exposes a few static\n      methods that allows creating application instance. The\n      <code>create()</code> method returns an object, which fulfills the\n      <code>INestApplication</code> interface, and provides a set of usable methods which are well described in the next\n      chapters.\n    </p>\n    <h4 id=\"running-application\">Running application</h4>\n    <p>\n      Once the installation process is complete, you can run the following command to start the HTTP server:\n    </p>\n    <pre><code class=\" language-bash \">\n$ npm run start</code></pre>\n    <p>\n      This command starts the HTTP server on the port defined inside the <code>src/main.ts</code> file. While the application\n      is running, open your browser and navigate to <code>http://localhost:3000/</code>. You should see the <code>Hello world!</code>      message.\n    </p>\n</div>"

