module.exports = "<div class=\"content\">\n  <h3>E2E Testing</h3>\n  <p>\n    The end to end testing is a great way to verify how the application works from <strong>beginning to end</strong>.\n    For example, when the application grows, it's difficult to manually test every API endpoint. The e2e tests help us to make sure that everything's working correctly and fits our requirements.\n  </p>\n  <p>\n    The steps to perform e2e tests are exactly the same as in the case of <a routerLink=\"/fundamentals/unit-testing\">unit testing</a>.\n    We're using <a href=\"https://github.com/facebook/jest\" target=\"blank\">Jest</a> library as a test runner and the <code>Test</code> static class to create a testing module.\n    Moreover, to simulate the HTTP requests, we've installed the <a href=\"https://github.com/visionmedia/supertest\" target=\"blank\">supertest</a> library.\n  </p>\n  <p>\n    Let's create an <code>e2e</code> directory and test the <code>CatsModule</code>.\n  </p>\n  <span class=\"filename\">\n    {{ 'cats.e2e-spec' | extension: e2eTestsT.isJsActive }}\n    <app-tabs #e2eTestsT></app-tabs>\n  </span>\n  <pre><code class=\"language-typescript\">{{ e2eTests }}</code></pre>\n  <blockquote>\n    <strong>Hint</strong> Keep your e2e test files inside the <code>e2e</code> directory. The testing files should have a <code>.e2e-spec</code> or <code>.e2e-test</code> suffix.\n  </blockquote>\n  <p>\n    Here's a <code>cats.e2e-spec.ts</code> test file. It contains a single HTTP request test, where we're checking whether the response looks like expected.\n  </p>\n  <p>\n    Notice that <code>TestingModule</code> instance provides an <code>overrideComponent()</code> method thus we can <strong>override</strong> the component which is the part of the imported module.\n    Also, we can successively override the guards and interceptors using <code>overrideGuard()</code> and <code>overrideInterceptor()</code>.\n  </p> \n  <p>\n    The compiled module has several methods well described in the following table:\n  </p>\n  <table>\n    <tr>\n      <td>\n        <code>createNestInstance()</code>\n      </td>\n      <td>\n        Creates a Nest instance based on a given module (returns <code>INestApplication</code>).\n        Notice that it's necessary to manually initialize the application using <code>init()</code> method.\n      </td>\n    </tr>\n    <tr>\n      <td>\n        <code>createNestMicroservice()</code>\n      </td>\n      <td>\n        Creates a Nest microservice instance based on a given module (returns <code>INestMicroservice</code>).\n      </td>\n    </tr>\n    <tr>\n    <td>\n      <code>get()</code>\n    </td>\n    <td>\n      Retrieves an instance of either controller or provider (including guards, filters, and so on) available in the application context.\n    </td>\n  </tr>\n  <tr>\n    <td>\n      <code>select()</code>\n    </td>\n    <td>\n      Navigates through the module tree, for example, to pull out a specific instance from the selected module (used together with enabled strict mode).\n    </td>\n  </tr>\n  </table>\n</div>"

