module.exports = "<div class=\"content\">\n  <h3>Testing</h3>\n  <p>\n    Automatic tests are an essential part of the fully functional <strong>software product</strong>.\n    That is very critical to cover at least the most sensitive parts of your system. \n    In order to achieve that goal, we produce a set of different tests like integration tests, unit tests, e2e tests, and so on.\n    And Nest provides a bunch of test utilities that improves testing experience.\n  </p>\n  <p>\n    In general, you can use any <strong>testing framework</strong> that you enjoy working with.\n    We don't enforce tooling, choose whatever fits your requirements.\n    The main Nest application starter is integrated with <a href=\"https://github.com/facebook/jest\" target=\"blank\">Jest</a> framework to reduce an amount of overhead when it comes to start writing your tests, but still, you can get rid of it and use any other tool easily.\n  </p>\n  <h4>Installation</h4>\n  <p>\n    Firstly, we need to install the required package:\n  </p>\n  <pre><code class=\"language-typescript\">\n$ npm i --save-dev @nestjs/testing</code></pre>\n  <h4>Unit testing</h4>\n  <p> \n    In the following example, we have two different classes, <code>CatsController</code> and <code>CatsService</code> respectively.\n    As mentioned before, <a href=\"https://github.com/facebook/jest\" target=\"blank\">Jest</a> is used as a fully-fledged testing framework.\n    That framework behaves like a test-runner and also, provides assert functions and test-doubles utilities that helps with mocking, spying, etc.\n    We have manually enforced <code>catsService.findAll()</code> method to return <code>result</code> variable, once it's called.\n    Thanks to that, we can test whether <code>catsController.findAll()</code> returns expected result, or not.\n  </p>\n  <span class=\"filename\">\n    {{ 'cats.controller.spec' | extension: isolatedTestsT.isJsActive }}\n    <app-tabs #isolatedTestsT></app-tabs>\n  </span>\n  <pre [class.hide]=\"isolatedTestsT.isJsActive\"><code class=\"language-typescript\">{{ isolatedTests }}</code></pre>\n  <pre [class.hide]=\"!isolatedTestsT.isJsActive\"><code class=\"language-typescript\">{{ isolatedTestsJs }}</code></pre>\n  <blockquote class=\"info\">\n    <strong>Hint</strong> Keep your test files nearby tested classes. The testing files should have a <code>.spec</code> or <code>.test</code> suffix.\n  </blockquote>\n  <p>\n    We didn't make use of any existing Nest testing utility so far. \n    Since we have manually taken care of instantiating tested classes, above test suite has nothing to do with Nest.\n    This type of testing is called <strong>isolated tests</strong>.\n  </p>\n  <h4>Testing utilities</h4>\n  <p>\n    The <code>@nestjs/testing</code> package gives us a set of utilities that boost the testing process.\n    Let's rewrite the previous example, but now, using exposed <code>Test</code> class.\n  </p>\n  <span class=\"filename\">\n    {{ 'cats.controller.spec' | extension: utilsT.isJsActive }}\n    <app-tabs #utilsT></app-tabs>\n  </span>\n  <pre [class.hide]=\"utilsT.isJsActive\"><code class=\"language-typescript\">{{ utils }}</code></pre>\n  <pre [class.hide]=\"!utilsT.isJsActive\"><code class=\"language-typescript\">{{ utilsJs }}</code></pre>\n  <p>\n    <code>Test</code> class has a <code>createTestingModule()</code> method that takes a module metadata (the same object as this one passed in <code>@Module()</code> decorator) as an argument.\n    This method creates a <code>TestingModule</code> instance which in turn provides a few methods, but only one of them is useful when it comes to unit tests - the <code>compile()</code>.\n    This function is <strong>asynchronous</strong>, therefore it has to be awaited. Once module is compiled, you can retrieve any instance using <code>get()</code> method. \n  </p>\n  <p>\n    In order to mock a real instance, you can override existing provider with a <a routerLink=\"/fundamentals/dependency-injection\">custom provider</a>.\n  </p>\n  <h4>End-to-end testing</h4>\n  <p>\n    When the application grows, it is difficult to manually test a behavior of each API endpoint. The end-to-end tests help us to make sure that everything is working correctly and fits project requirements.\n    To perform e2e tests we use the same configuration as in the case of <strong>unit testing</strong>, but additionally, we take advantage of <a href=\"https://github.com/visionmedia/supertest\" target=\"blank\">supertest</a> library that allows simulating HTTP requests.\n  </p>\n  <span class=\"filename\">\n    {{ 'cats.e2e-spec' | extension: e2eTestsT.isJsActive }}\n    <app-tabs #e2eTestsT></app-tabs>\n  </span>\n  <pre><code class=\"language-typescript\">{{ e2eTests }}</code></pre>\n  <blockquote class=\"info\">\n    <strong>Hint</strong> Keep your e2e test files inside the <code>e2e</code> directory. The testing files should have a <code>.e2e-spec</code> or <code>.e2e-test</code> suffix.\n  </blockquote>\n  <p>\n    The <code>cats.e2e-spec.ts</code> test file contains a single HTTP endpoint test (<code>/cats</code>).\n    We have used <code>app.getHttpServer()</code> method to pick up an underlying HTTP server that runs in the background of Nest application.\n    Notice that <code>TestingModule</code> instance provides a <code>overrideProvider()</code> method, and thus we can <strong>override</strong> the existing provider which is declared by the imported module.\n    Also, we can successively override the guards, interceptors, filters, and pipes using corresponding methods, <code>overrideGuard()</code>, <code>overrideInterceptor()</code>, <code>overrideFilter()</code>, and <code>overridePipe()</code> respectively.\n  </p> \n  <p>\n    The compiled module has several methods well described in the following table:\n  </p>\n  <table>\n      <tr>\n        <td>\n          <code>createNestInstance()</code>\n        </td>\n        <td>\n          Creates a Nest instance based on a given module (returns <code>INestApplication</code>).\n          Notice that it's necessary to manually initialize the application using <code>init()</code> method.\n        </td>\n      </tr>\n      <tr>\n        <td>\n          <code>createNestMicroservice()</code>\n        </td>\n        <td>\n          Creates a Nest microservice instance based on a given module (returns <code>INestMicroservice</code>).\n        </td>\n      </tr>\n      <tr>\n      <td>\n        <code>get()</code>\n      </td>\n      <td>\n        Retrieves an instance of either controller or provider (including guards, filters, and so on) available in the application context.\n      </td>\n    </tr>\n    <tr>\n      <td>\n        <code>select()</code>\n      </td>\n      <td>\n        Navigates through the module tree, for example, to pull out a specific instance from the selected module (used together with enabled strict mode).\n      </td>\n    </tr>\n  </table>\n</div>"

