module.exports = "<div class=\"content\">\n  <h3>Subscriptions</h3>\n  <p>\n    Subscription is just another GraphQL operation type like Query and Mutation. It allows creating real-time\n    subscriptions over\n    a bidirectional transport layer, mainly over websockets. Read more about the subscriptions <a href=\"https://www.apollographql.com/docs/graphql-subscriptions\"\n      target=\"blank\">here</a>. Below is a <code>commentAdded</code> subscription example, copied and pasted directly\n    from the official <a href=\"https://www.apollographql.com/docs/graphql-subscriptions/subscriptions-to-schema.html\"\n      target=\"blank\">Apollo</a> documentation:\n  </p>\n  <pre><code class=\"language-typescript\">{{ subscriptionOfficialExample }}</code></pre>\n  <blockquote class=\"warning\">\n    <strong>Notice</strong> The <code>pubsub</code> is an instance of <code>PubSub</code> class. Read more about it <a\n      href=\"https://www.apollographql.com/docs/graphql-subscriptions/setup.html\" target=\"blank\">here</a>.\n  </blockquote>\n  <p>\n    In order to create an equivalent subscription in Nest, we'll make use of the\n    <code>@Subscription()</code> decorator. Let's extend our\n    <code>AuthorResolver</code> used in the <a routerLink=\"/graphql/resolvers-map\">resolvers</a> section.\n  </p>\n  <pre><code class=\"language-typescript\">{{ resolversWithNames }}</code></pre>\n  <p>\n    We have used a local <code>PubSub</code> instance here. Instead, we should define <code>PubSub</code> as a <strong>provider</strong>,\n    inject it through the constructor (using <code>@Inject()</code> decorator), and reuse it across the whole\n    application.\n    You can read more about Nest custom providers <a routerLink=\"/fundamentals/custom-providers\">here</a>.\n  </p>\n  <h4>Module</h4>\n  <p>\n    In order to enable subscriptions, we have to set <code>installSubscriptionHandlers</code> property to <code>true</code>.\n  </p>\n  <pre><code class=\"language-java\">{{ enableSubscriptions }}</code></pre>\n  <p>\n    To customize the subscriptions server (e.g. change port), you can use <code>subscriptions</code> property (read <a\n      href=\"https://www.apollographql.com/docs/apollo-server/v2/api/apollo-server.html#constructor-options-lt-ApolloServer-gt\"\n      target=\"blank\">more</a>).\n  </p>\n  <h4>Type definitions</h4>\n  <p>\n    The last step is to update type definitions file.\n  </p>\n  <pre><code class=\"language-java\">{{ typeDefs }}</code></pre>\n  <p>\n    Well done. We created a single <code>commentAdded(repoFullName: String!): Comment</code> subscription.\n    You can find a full sample implementation <a href=\"https://github.com/nestjs/nest/blob/master/sample/12-graphql-apollo\"\n      target=\"blank\">here</a>.\n  </p>\n</div>"

