module.exports = "<div class=\"content\">\n  <h3>Introduction</h3>\n  <p>Nest is a framework for building efficient, scalable <a href=\"http://nodejs.org\" target=\"_blank\">Node.js</a>\n    server-side\n    applications. It uses progressive JavaScript, is built with <a href=\"http://www.typescriptlang.org\" target=\"_blank\">TypeScript</a>\n    (preserves compatibility with pure JavaScript) and combines elements of OOP (Object Oriented Programming), FP\n    (Functional\n    Programming), and FRP (Functional Reactive Programming).</p>\n  <p>Under the hood, Nest makes use of <a href=\"https://expressjs.com/\" target=\"_blank\">Express</a>, but also provides\n    compatibility\n    with a wide range of other libraries (e.g. <a href=\"https://github.com/fastify/fastify\" target=\"_blank\">Fastify</a>).\n    This allows for easy use of the myriad third-party plugins which are available.</p>\n\n  <h3>Philosophy</h3>\n  <p>In recent years, thanks to Node.js, JavaScript has become the “lingua franca” of the web for both front and\n    backend\n    applications. This has given rise to awesome projects like <a href=\"https://angular.io/\" target=\"_blank\">Angular</a>,\n    <a href=\"https://github.com/facebook/react\" target=\"_blank\">React</a> and <a href=\"https://github.com/vuejs/vue\"\n      target=\"_blank\">Vue</a>\n    which improve developer productivity and enable the construction of fast, testable, and extensible frontend\n    applications.\n    However, while plenty of superb libraries, helpers, and tools exist for Node (and server-side JavaScript), none of\n    them\n    effectively solve the main problem - <strong>architecture</strong>.</p>\n  <p>Nest provides an out-of-the-box application architecture which allows for effortless creation of highly testable,\n    scalable,\n    loosely coupled, and easily maintainable applications.</p>\n\n  <h3>Installation</h3>\n  <p>To get started, scaffold the base project with the <a routerLink=\"/cli/overview\">Nest CLI</a>:</p>\n  <pre><code class=\"language-bash\">\n$ npm i -g @nestjs/cli\n$ nest new project-name</code></pre>\n\n  <p>Install the starter project with <strong>Git</strong>:</p>\n  <span class=\"filename\">\n    <app-tabs #starter></app-tabs>\n  </span>\n  <pre [class.hide]=\"starter.isJsActive\"><code class=\"language-bash\">\n$ git clone https://github.com/nestjs/typescript-starter.git project\n$ cd project\n$ npm install\n$ npm run start</code></pre>\n  <pre [class.hide]=\"!starter.isJsActive\"><code class=\"language-bash\">\n$ git clone https://github.com/nestjs/javascript-starter.git project\n$ cd project\n$ npm install\n$ npm run start</code></pre>\n\n  <p>Or start a new project from scratch with <strong>npm</strong> (or <strong>yarn</strong>):</p>\n  <pre><code class=\"language-bash\">\n$ npm i --save @nestjs/core @nestjs/common rxjs reflect-metadata</code></pre>\n  <h3>Stay in touch</h3>\n  <ul>\n    <li>Author - <a href=\"https://kamilmysliwiec.com\" title=\"Kamil Mysliwiec Blog | Full-Stack Software Engineer\"\n        target=\"blank\">Kamil\n        Myśliwiec\n      </a></li>\n    <li>Website - <a href=\"https://nestjs.com\" title=\"NestJS - A node.js framework built on top of TypeScript\" target=\"blank\">https://nestjs.com</a></li>\n    <li>Twitter - <a href=\"https://twitter.com/nestframework\" target=\"blank\">@nestframework</a></li>\n  </ul>\n</div>"

