module.exports = "<div class=\"content\">\n  <h3>gRPC</h3>\n  <p>\n    The <a href=\"https://github.com/grpc/grpc-node\" target=\"blank\">gRPC</a> is a high-performance, open-source universal\n    RPC framework.\n  </p>\n  <h4>Installation</h4>\n  <p>Before we start, we have to install required package:</p>\n  <pre><code class=\"language-bash\">\n$ npm i --save grpc @grpc/proto-loader</code></pre>\n  <h4>Transporter</h4>\n  <p>\n    In order to switch to <strong>gRPC</strong> transporter, we need to modify an options object passed to the <code>createMicroservice()</code>    method.\n  </p>\n  <span class=\"filename\">\n    {{ 'main' | extension: optionsT.isJsActive }}\n    <app-tabs #optionsT></app-tabs>\n  </span>\n  <pre><code class=\"language-typescript\">{{ options }}</code></pre>\n  <blockquote class=\"info\">\n    <strong>Hint</strong> The <code>join()</code> function is imported from <code>path</code> package.\n  </blockquote>\n  <h4>Options</h4>\n  <p>\n    There are a bunch of available options that determine a transporter behavior.\n  </p>\n  <table>\n    <tr>\n      <td><code>url</code></td>\n      <td>Connection url</td>\n    </tr>\n    <tr>\n      <td><code>protoPath</code></td>\n      <td>Absolute (or relative to the root dir) path to the <code>.proto</code> file</td>\n    </tr>\n    <tr>\n      <td><code>loader</code></td>\n      <td><code>@grpc/proto-loader</code> options. They are well-described <a href=\"https://github.com/grpc/grpc-node/tree/master/packages/grpc-protobufjs#usage\"\n          target=\"blank\">here</a>.</td>\n    </tr>\n    <tr>\n      <td><code>package</code></td>\n      <td>Protobuf package name</td>\n    </tr>\n    <tr>\n      <td><code>credentials</code></td>\n      <td>Server credentials (<a href=\"https://grpc.io/grpc/node/grpc.ServerCredentials.html\" target=\"blank\">read more</a>)</td>\n    </tr>\n  </table>\n  <h4>Overview</h4>\n  <p>\n    In general, a <code>package</code> property sets a <a href=\"https://developers.google.com/protocol-buffers/docs/proto\"\n      target=\"blank\">protobuf</a> package name, while <code>protoPath</code> is a path to the <code>.proto</code> definitions\n    file. The <code>hero.proto</code> file is structured using protocol buffer language.\n  </p>\n  <span class=\"filename\">\n    hero.proto\n  </span>\n  <pre><code class=\"language-typescript\">{{ heroProto }}</code></pre>\n  <p>\n    In the above example, we defined a <code>HeroService</code> that exposes a <code>FindOne()</code> gRPC handler which\n    expects <code>HeroById</code> as an input and returns a <code>Hero</code> message. In order to define a handler that\n    fulfills this protobuf definition, we have to use a <code>@GrpcMethod()</code> decorator. The previously known <code>@MessagePattern()</code>    is\n    no longer useful.\n  </p>\n  <span class=\"filename\">\n    {{ 'hero.controller' | extension: grpcHandlerT.isJsActive }}\n    <app-tabs #grpcHandlerT></app-tabs>\n  </span>\n  <pre [class.hide]=\"grpcHandlerT.isJsActive\"><code class=\"language-typescript\">{{ grpcHandler }}</code></pre>\n  <pre [class.hide]=\"!grpcHandlerT.isJsActive\"><code class=\"language-typescript\">{{ grpcHandlerJs }}</code></pre>\n  <blockquote class=\"info\">\n    <strong>Hint</strong> The <code>@GrpcMethod()</code> decorator is imported from <code>@nestjs/microservices</code> package.\n  </blockquote>\n  <p>\n    The <code>HeroService</code> is a service's name, while <code>FindOne</code> points to a <code>FindOne()</code> gRPC\n    handler. The corresponding <code>findOne()</code> method takes two arguments, the <code>data</code> passed from the caller\n    and <code>metadata</code> that stores gRPC request's metadata.\n  </p>\n  <p>\n    Furthermore, the <code>FindOne</code> is actually redundant here. If you don't pass a second argument to the <code>@GrpcMethod()</code>,\n    Nest will automatically use the method name with the capitalized first letter, for example, <code>findOne</code> -> <code>FindOne</code>.\n  </p>\n  <span class=\"filename\">\n    {{ 'hero.controller' | extension: grpcHandlerMethodT.isJsActive }}\n    <app-tabs #grpcHandlerMethodT></app-tabs>\n  </span>\n  <pre [class.hide]=\"grpcHandlerMethodT.isJsActive\"><code class=\"language-typescript\">{{ grpcHandlerMethod }}</code></pre>\n  <pre [class.hide]=\"!grpcHandlerMethodT.isJsActive\"><code class=\"language-typescript\">{{ grpcHandlerMethodJs }}</code></pre>\n  <p>\n    Likewise, you might not pass any argument. In this case, Nest would use a class name.\n  </p>\n  <span class=\"filename\">\n    {{ 'hero.controller' | extension: grpcHandlerClassT.isJsActive }}\n    <app-tabs #grpcHandlerClassT></app-tabs>\n  </span>\n  <pre [class.hide]=\"grpcHandlerClassT.isJsActive\"><code class=\"language-typescript\">{{ grpcHandlerClass }}</code></pre>\n  <pre [class.hide]=\"!grpcHandlerClassT.isJsActive\"><code class=\"language-typescript\">{{ grpcHandlerClassJs }}</code></pre>\n  <h4>Client</h4>\n  <p>\n    In order to create a client instance, we need to make use of <code>@Client()</code> decorator.\n  </p>\n  <span class=\"filename\">\n    {{ 'hero.controller' | extension: grpcClientT.isJsActive }}\n    <app-tabs #grpcClientT></app-tabs>\n  </span>\n  <pre [class.hide]=\"grpcClientT.isJsActive\"><code class=\"language-typescript\">{{ grpcClient }}</code></pre>\n  <pre [class.hide]=\"!grpcClientT.isJsActive\"><code class=\"language-typescript\">{{ grpcClientJs }}</code></pre>\n  <p>\n    There is a small difference compared to the previous examples. Instead of the <code>ClientProxy</code> class, we use\n    the <code>ClientGrpc</code> that provides a <code>getService()</code> method. The <code>getService()</code> generic method\n    takes service's name as an argument and returns its instance if available.\n  </p>\n  <span class=\"filename\">\n    {{ 'hero.controller' | extension: serviceInstanceT.isJsActive }}\n    <app-tabs #serviceInstanceT></app-tabs>\n  </span>\n  <pre [class.hide]=\"serviceInstanceT.isJsActive\"><code class=\"language-typescript\">{{ serviceInstance }}</code></pre>\n  <pre [class.hide]=\"!serviceInstanceT.isJsActive\"><code class=\"language-typescript\">{{ serviceInstanceJs }}</code></pre>\n  <p>\n    The <code>heroService</code> object exposes the same set of methods that have been defined inside <code>.proto</code>    file.\n    Note, all of them are <strong>lowercased</strong> (in order to follow the natural convention). Basically, our gRPC <code>HeroService</code>    definition\n    contains <code>FindOne()</code> function. It means that <code>heroService</code> instance will provide the <code>findOne()</code>    method.\n  </p>\n  <pre><code class=\"language-typescript\">{{ heroService }}</code></pre>\n  <p>\n    All service's methods return <code>Observable</code>. Since Nest supports <a href=\"https://github.com/reactivex/rxjs\">RxJS</a>\n    streams and works pretty well with them, we can return them within HTTP handler as well.\n  </p>\n  <span class=\"filename\">\n    {{ 'hero.controller' | extension: heroControllerT.isJsActive }}\n    <app-tabs #heroControllerT></app-tabs>\n  </span>\n  <pre [class.hide]=\"heroControllerT.isJsActive\"><code class=\"language-typescript\">{{ heroController }}</code></pre>\n  <pre [class.hide]=\"!heroControllerT.isJsActive\"><code class=\"language-typescript\">{{ heroControllerJs }}</code></pre>\n  <p>\n    A full working example is available <a href=\"https://github.com/nestjs/nest/tree/master/sample/04-grpc\" target=\"blank\">here</a>.\n  </p>\n</div>"

