module.exports = "<div class=\"content\">\n    <h3>SQL (Sequelize)</h3>\n    <h5>This chapter applies only to TypeScript</h5>\n    <p>\n      <a href=\"https://github.com/sequelize/sequelize\" target=\"blank\">Sequelize</a> is a popular Object Relational Mapper (ORM)\n      written in a vanilla JavaScript, but there is a <a href=\"https://github.com/RobinBuschmann/sequelize-typescript\" target=\"blank\">sequelize-typescript</a> TypeScript wrapper which provides a set of decorators and other extras for the base sequelize.\n      To start the adventure with this library we have to install the following dependencies:\n    </p>\n    <pre><code class=\"language-typescript\">{{ dependencies }}</code></pre>\n    <p>\n      The first step we need to do is create a <strong>Sequelize</strong> instance with an options object passed into the constructor.\n      Also, we need to add all models (the alternative is to use <code>modelPaths</code> property) and <code>sync()</code> our database tables.\n    </p>\n    <span class=\"filename\">database.providers.ts</span>\n    <pre><code class=\"language-typescript\">{{ databaseProviders }}</code></pre>\n    <blockquote class=\"warning\">\n        <strong>Hint</strong> Following best practices, we declared the custom provider in the separated file which has a <code>*.providers.ts</code> suffix.\n     </blockquote>\n     <p>\n       Then, we need to export these providers to make them <strong>accessible</strong> for the rest part of the application.\n    </p>\n    <span class=\"filename\">database.module.ts</span>\n    <pre><code class=\"language-typescript\">{{ databaseModule }}</code></pre>\n    <p>\n      Now we can inject the <code>Sequelize</code> object using <code>@Inject()</code> decorator.\n      Each class that would depend on the <code>Sequelize</code> async provider will wait until a <code>Promise</code> is resolved.\n    </p>\n    <h4>Model injection</h4>\n    <p>\n      In <a href=\"https://github.com/sequelize/sequelize\" target=\"blank\">Sequelize</a> the <strong>Model</strong> defines a table in the database. Instances of this class represent a database row.\n      Firstly, we need at least one entity:\n    </p>\n    <span class=\"filename\">cats/cat.entity.ts</span>\n    <pre><code class=\"language-typescript\">{{ catEntity }}</code></pre>\n    <p>\n      The <code>Cat</code> entity belongs to the <code>cats</code> directory.\n      This directory represents the <code>CatsModule</code>.\n      Now it's time to create a <strong>Repository</strong> component:\n    </p>\n    <span class=\"filename\">cats.providers.ts</span>\n    <pre><code class=\"language-typescript\">{{ catsProviders }}</code></pre>\n    <blockquote>\n        <strong>Notice</strong> In the real-world applications you should avoid <strong>magic strings</strong>. Both <code>CatsRepository</code> and <code>SequelizeToken</code> should be kept in the separated <code>constants.ts</code> file.\n     </blockquote>\n     <p>\n       In Sequelize, we use static methods to manipulate the data, and thus we created an <strong>alias</strong> here.\n     </p>\n     <p>\n       Now we can inject the <code>CatsRepository</code> to the <code>CatsService</code> using the <code>@Inject()</code> decorator:\n     </p>\n     <span class=\"filename\">cats.service.ts</span>\n    <pre><code class=\"language-typescript\">{{ catsService }}</code></pre>\n    <p>\n      The database connection is <strong>asynchronous</strong>, but Nest makes this process completely invisible for the end-user.\n      The <code>CatsRepository</code> provider is waiting for the db connection, and the <code>CatsService</code> is delayed until repository is ready to use.\n      The entire application can start when each class is instantiated.\n    </p>\n    <p>\n      Here is a final <code>CatsModule</code>:\n    </p>\n    <span class=\"filename\">cats.module.ts</span>\n    <pre><code class=\"language-typescript\">{{ catsModule }}</code></pre>\n    <blockquote class=\"warning\">\n        <strong>Hint</strong> Don't forget to import the <code>CatsModule</code> into the root <code>ApplicationModule</code>.\n     </blockquote>\n  </div>\n"

