module.exports = "<div class=\"content\">\n  <h3>Caching</h3>\n  <p>\n    Cache is a great and simple <strong>technique</strong> that helps in improving your app's performance. It acts as a temporary\n    data store, which accessing is really performant.\n  </p>\n  <h4>Installation</h4>\n  <p>\n    We need to install the required package at first:\n  </p>\n  <pre><code class=\"language-bash\">$ npm install --save cache-manager</code></pre>\n  <h4>In-memory cache</h4>\n  <p>\n    Nest provides a unified API for various cache storages. The built-in one is an in-memory data store. However, you can easily\n    switch to a more comprehensive solution, like Redis. In order to enable caching, firstly import <code>CacheModule</code>    and\n    call its <code>register()</code> method.\n  </p>\n  <pre><code class=\"language-typescript\">{{ inMemoryCache }}</code></pre>\n  <p>\n    Then just tie <code>CacheInterceptor</code> somewhere.\n  </p>\n  <pre><code class=\"language-typescript\">{{ appController }}</code></pre>\n  <blockquote class=\"warning\">\n    <strong>Warning</strong>\n    Only <code>GET</code> endpoints are cached.\n  </blockquote>\n  <h4>Global cache</h4>\n  <p>\n    To reduce an amount of the required boilerplate, you can bind <code>CacheInterceptor</code> to each existing endpoint\n    at once.\n  </p>\n  <pre><code class=\"language-typescript\">{{ globalCache }}</code></pre>\n  <h4>WebSockets & Microservices</h4>\n  <p>\n    Obviously, you can effortlessly apply <code>CacheInterceptor</code> to WebSocket subscribers as well as Microservice's\n    patterns (regardless of transport method that is being used).\n  </p>\n  <pre><code class=\"language-typescript\">{{ websockets }}</code></pre>\n  <blockquote class=\"info\">\n    <strong>Hint</strong>\n    The <code>@CacheKey()</code> decorator is imported from <code>@nestjs/common</code> package.\n  </blockquote>\n  <p>\n    However, the additional <code>@CacheKey()</code> decorator is required in order to specify a key used to subsequently\n    store and retrieve cached data. Besides, please note that you <strong>shouldn't cache everything</strong>. Actions which\n    responsibility is to perform some business operations rather than simply querying the data should never be cached.\n  </p>\n  <h4>Customize caching</h4>\n  <p>\n    All cached data have its own expiration time (TTL). To customize default values, pass options object to the <code>register()</code>    method.\n  </p>\n  <pre><code class=\"language-typescript\">{{ customizeCache }}</code></pre>\n  <h4>Different stores</h4>\n  <p>\n    We take advantage of <a href=\"https://github.com/BryanDonovan/node-cache-manager\" target=\"blank\">cache-manager</a> under\n    the hood. This package supports a wide-range of useful stores, for example, <a href=\"https://github.com/dabroek/node-cache-manager-redis-store\"\n      target=\"blank\">Redis</a> store (full list <a href=\"https://github.com/BryanDonovan/node-cache-manager#store-engines\"\n      target=\"blank\">here</a>). To set up the Redis store, simple pass the package together with correspoding options to the\n    <code>register()</code> method.\n  </p>\n  <pre><code class=\"language-typescript\">{{ redisStore }}</code></pre>\n  <h4>Adjust tracking</h4>\n  <p>\n    By default, Nest uses request URL (in HTTP app) or cache key (in websockets and microservices) set through <code>@CacheKey()</code>    decorator\n    to associate cache records with your endpoints. Nevertheless, sometimes you might want to set up tracking based on different\n    factors, for example, using HTTP headers (e.g. <code>Authorization</code> to properly identify <code>profile</code> endpoints).\n  </p>\n  <p>\n    In order to achieve that, create a subclass of <code>CacheInterceptor</code> and override <code>trackBy()</code> method.\n  </p>\n  <pre><code class=\"language-typescript\">{{ trackBy }}</code></pre>\n  <h4>Async configuration</h4>\n  <p>\n    Quite often you might want to asynchronously pass your module options instead of passing them beforehand. In such case, use\n    <code>registerAsync()</code> method, that provides a couple of various ways to deal with async data.\n  </p>\n  <p>\n    First possible approach is to use a factory function:\n  </p>\n  <pre><code class=\"language-typescript\">{{ asyncConfiguration }}</code></pre>\n  <p>\n    Obviously, our factory behaves like every other one (might be <code>async</code> and is able to inject dependencies through\n    <code>inject</code>).\n  </p>\n  <pre><code class=\"language-typescript\">{{ asyncConfigurationFactoryAsync }}</code></pre>\n  <p>\n    Alternatively, you are able to use class instead of a factory.\n  </p>\n  <pre><code class=\"language-typescript\">{{ asyncConfigurationClass }}</code></pre>\n  <p>\n    Above construction will instantiate <code>CacheConfigService</code> inside <code>CacheModule</code> and will leverage\n    it to create options object. The <code>CacheConfigService</code> has to implement <code>CacheOptionsFactory</code> interface.\n  </p>\n  <pre><code class=\"language-typescript\">{{ asyncConfigurationClassBody }}</code></pre>\n  <p>\n    In order to prevent the creation of <code>CacheConfigService</code> inside <code>CacheModule</code> and use a provider\n    imported from a different module, you can use the <code>useExisting</code> syntax.\n  </p>\n  <pre><code class=\"language-typescript\">{{ asyncConfigurationExisting }}</code></pre>\n  <p>\n    It works the same as <code>useClass</code> with one critical difference - <code>CacheModule</code> will lookup imported\n    modules to reuse already created <code>ConfigService</code>, instead of instantiating it on its own.\n  </p>\n</div>\n"

