module.exports = "<div class=\"content\">\n  <h3>Compression</h3>\n  <p>\n    Compression can greatly decrease the size of the response body and hence increase the speed of a web app. Use the <a\n      href=\"https://github.com/expressjs/compression\" target=\"blank\">compression</a> middleware to enable gzip compression.\n  </p>\n  <h4>Installation</h4>\n  <p>Firstly, install the required package:</p>\n  <pre><code class=\"language-bash\">\n$ npm i --save compression</code></pre>\n  <p>\n    Once the installation is completed, apply it as a global middleware.\n  </p>\n  <pre><code class=\"language-typescript\">\nimport * as compression from 'compression';\n// somewhere in your initialization file\napp.use(compression());</code></pre>\n  <blockquote class=\"info\">\n    <strong>Hint</strong>\n    If you work wtih <code>FastifyAdapter</code>, consider using <a href=\"hhttps://github.com/fastify/fastify-compress\" target=\"blank\">fastify-compress</a>\n    instead.\n  </blockquote>\n  <p>\n    For a <strong>high-traffic</strong> website in production, the best way to put compression in place is to implement it\n    at a reverse proxy level. In that case, you do not need to use compression middleware.\n  </p>\n</div>"

