module.exports = "<div class=\"content\">\n  <h3>Hot Reload (Webpack)</h3>\n  <p>\n    The highest impact on your application's bootstrapping process has a <strong>TypeScript compilation</strong>.\n    But the question is, do we have to recompile a whole project each time when change occurs? Not at all.\n    That's why <a href=\"https://github.com/webpack/webpack\" target=\"blank\">webpack</a> HMR (Hot-Module Replacement) significantly decreases an amount of time necessary to instantiate your application.\n  </p>\n  <h4>Installation</h4>\n  <p>\n    Firstly, let's install required packages:\n  </p>\n  <pre><code class=\"language-typescript\">{{ packages }}</code></pre>\n  <h4>Configuration</h4>\n  <p>\n    Then, we need to create a <code>webpack.config.js</code> which is a webpack's configuration file, and put it in the root directory.\n  </p>\n  <pre><code class=\"language-typescript\">{{ configuration }}</code></pre>\n  <p>\n    This configuration tells webpack few essential things about our application. Where sits an entry file, which directory should be used to hold <strong>compiled</strong> files, and also, what kind of loader we want to use in order to compile source files.\n    Basically, you shouldn't worry to much, you don't need to understand the content of this file at all.\n  </p>\n  <h4>Hot-Module Replacement</h4>\n  <p>\n    In order to enable <strong>HMR</strong>, we have to open Nest application entry file (which is <code>main.ts</code>) and add few critical things.\n  </p>\n  <pre><code class=\"language-typescript\">{{ main }}</code></pre>\n  <p>\n    And that's all. To simplify execution process, add those two lines into your <code>scripts</code> inside <code>package.json</code> file.\n  </p>\n  <pre><code class=\"language-typescript\">{{ scripts }}</code></pre>\n  <p>\n    Now simply open your command line and run below command:\n  </p>\n  <pre><code class=\"language-bash\">{{ webpackStart }}</code></pre>\n  <p>\n    Once webpack started to <strong>watch files</strong>, run another command in the another command line window:\n  </p>\n  <pre><code class=\"language-bash\">{{ start }}</code></pre>\n  <p>\n    A working example is available <a href=\"https://github.com/nestjs/nest/tree/master/sample/08-webpack\">here</a>.\n  </p>\n</div>"

