module.exports = "<div class=\"content\">\n  <h3>HTTP module</h3>\n  <p>\n    <a href=\"https://github.com/axios/axios\" target=\"blank\">Axios</a> is rich-feature HTTP client that is widely used in\n    dozens of applications. That's why Nest wraps this package and exposes it by default as a built-in <code>HttpModule</code>.\n    The <code>HttpModule</code> exports <code>HttpService</code> that simply exposes axios-based methods to perform HTTP\n    request, but also, transforms return types into <code>Observables</code>.\n  </p>\n  <p>\n    In order to use a <code>HttpService</code>, we need to import <code>HttpModule</code>.\n  </p>\n  <pre><code class=\"language-typescript\">{{ httpModule }}</code></pre>\n  <blockquote class=\"info\">\n    <strong>Hint</strong> The <code>HttpModule</code> is exposed from <code>@nestjs/common</code> package.\n  </blockquote>\n  <p>\n    Then, you can inject <code>HttpService</code>. This class is easily accessible from <code>@nestjs/common</code> package.\n  </p>\n  <span class=\"filename\">\n    <app-tabs #httpServiceT></app-tabs>\n  </span>\n  <pre [class.hide]=\"httpServiceT.isJsActive\"><code class=\"language-typescript\">{{ httpService }}</code></pre>\n  <pre [class.hide]=\"!httpServiceT.isJsActive\"><code class=\"language-typescript\">{{ httpServiceJs }}</code></pre>\n  <p>\n    All methods return <code>AxiosResponse</code> wrapped with <code>Observable</code> object.\n  </p>\n  <h4>Configuration</h4>\n  <p>\n    <a href=\"https://github.com/axios/axios\" target=\"blank\">Axios</a> gives a bunch of options that you may take advantage\n    of to make your <code>HttpService</code> even more powerful. Read more about them <a href=\"https://github.com/axios/axios#request-config\"\n      target=\"blank\">here</a>. To configure underlying library instance, use <code>register()</code> method of <code>HttpModule</code>.\n  </p>\n  <pre><code class=\"language-typescript\">{{ configuration }}</code></pre>\n  <p>\n    All these properties will be passed down to the <strong>axios</strong> constructor.\n  </p>\n</div>"

