module.exports = "<div class=\"content\">\n  <h3>Model-View-Controller</h3>\n  <p>\n    Nest, by default, makes use of <a href=\"https://github.com/expressjs/express\" target=\"blank\">express</a> library under\n    the hood. Hence, every tutorial about MVC (Model-View-Controller) pattern in express concerns Nest as well. Firstly,\n    let's scaffold a simple Nest application using <a href=\"https://github.com/nestjs/nest-cli\" target=\"blank\">CLI</a> tool:\n  </p>\n  <pre><code class=\"language-bash\">\n$ npm i -g @nestjs/cli\n$ nest new project</code></pre>\n  <p>\n    In order to create a MVC app, we have to install a <a href=\"http://expressjs.com/en/guide/using-template-engines.html\"\n      target=\"blank\">template engine</a>:\n  </p>\n  <pre><code class=\"language-bash\">\n$ npm install --save hbs</code></pre>\n  <p>\n    We decided to use a <code>hbs</code> engine, though, you can use whatever fits your requirements. Once the installation\n    process is completed, we need to configure the express instance using following code:\n  </p>\n  <span class=\"filename\">\n    {{ 'main' | extension: mainT.isJsActive }}\n    <app-tabs #mainT></app-tabs>\n  </span>\n  <pre><code class=\"language-typescript\">{{ main }}</code></pre>\n  <p>\n    We told <a href=\"https://github.com/expressjs/express\" target=\"blank\">express</a> that the <code>public</code> directory\n    will be used for storing static assets,\n    <code>views</code> will contain templates, and a <code>hbs</code> template engine should be used to render an HTML output.\n  </p>\n  <p>\n    Now, let's create a <code>views</code> directory and <code>index.hbs</code> template inside it. In the template, we are\n    gonna print a <code>message</code> passed from the controller:\n  </p>\n  <span class=\"filename\">index.hbs</span>\n  <pre><code class=\"language-html\">{{ index }}</code></pre>\n  <p>\n    Afterward, open the <code>app.controller</code> file and replace the <code>root()</code> method with the following code:\n  </p>\n  <span class=\"filename\">\n    {{ 'app.controller' | extension: rootT.isJsActive }}\n    <app-tabs #rootT></app-tabs>\n  </span>\n  <pre [class.hide]=\"rootT.isJsActive\"><code class=\"language-typescript\">{{ root }}</code></pre>\n  <pre [class.hide]=\"!rootT.isJsActive\"><code class=\"language-typescript\">{{ rootJs }}</code></pre>\n  <blockquote class=\"info\">\n    <strong>Hint</strong> In fact, when Nest detects <code>@Res()</code> decorator, it injects library-specific <code>response</code>    object.\n    Learn more about its abilities <a href=\"http://expressjs.com/en/api.html\" target=\"blank\">here</a>.\n  </blockquote>\n  <p>\n    While the application is running, open your browser and navigate to <code>http://localhost:3000/</code>. You should see\n    the <code>Hello world!</code> message.\n  </p>\n  <h4>Example</h4>\n  <p>\n    A working example is available <a href=\"https://github.com/nestjs/nest/tree/master/sample/15-mvc\">here</a>.\n  </p>\n  <h4>Fastify</h4>\n  <p>\n    As mentioned in this <a routerLink=\"/techniques/http-performance\">chapter</a>, we are able to use any compatible HTTP\n    provider together with Nest. One of them is a <a href=\"https://github.com/fastify/fastify\" target=\"_blank\">fastify</a>\n    library. In order to create a MVC application with fastify, we have to install following packages:\n  </p>\n  <pre><code class=\"language-bash\">\n$ npm i --save fastify point-of-view handlebars</code></pre>\n  <p>\n    The next steps cover almost the same stuff as in case of express library (with small differences). Once the installation\n    process is completed, we need to open <code>main.ts</code> file and update its contents:\n  </p>\n  <span class=\"filename\">\n    {{ 'main' | extension: mainT.isJsActive }}\n    <app-tabs #mainT></app-tabs>\n  </span>\n  <pre><code class=\"language-typescript\">{{ mainFastify }}</code></pre>\n  <p>\n    The API is different a little but the idea that sits behind those methods calls remains the same. Also, we have to ensure\n    that the template name passed into the <code>@Render()</code> decorators include a file extension.\n  </p>\n  <span class=\"filename\">\n    {{ 'app.controller' | extension: rootFastifyT.isJsActive }}\n    <app-tabs #rootFastifyT></app-tabs>\n  </span>\n  <pre><code class=\"language-typescript\">{{ rootFastify }}</code></pre>\n  <p>\n    While the application is running, open your browser and navigate to <code>http://localhost:3000/</code>. You should see\n    the <code>Hello world!</code> message.\n  </p>\n  <h4>Example</h4>\n  <p>\n    A working example is available <a href=\"https://github.com/nestjs/nest/tree/master/sample/17-mvc-fastify\">here</a>.\n  </p>\n</div>"

