module.exports = "<div class=\"content\">\n  <h3>Performance (Fastify)</h3>\n  <p>Under the hood, Nest makes use of\n    <a href=\"https://expressjs.com/\" target=\"_blank\">Express</a>, but as mentioned already, provides compatibility with\n    a wide range of other libraries, like e.g.\n    <a href=\"https://github.com/fastify/fastify\" target=\"_blank\">Fastify</a>. How does it work?\n    In fact, what Nest needs to use your favorite library, is a compatible adapter, that primarily proxies\n    corresponding handlers to appropriate library-specific methods.\n    Additionally, your library has to provide at least similar request-response cycle management as express.\n  </p>\n  <p>\n    A <a href=\"https://github.com/fastify/fastify\" target=\"_blank\">Fastify</a> fits here very well because it solves\n    design issues in a similar manner as express does.\n    However, fastify is much <strong>faster</strong>, achieving almost two times better benchmarks results. The\n    question, why Nest still uses express as a default HTTP provider then? Because express is widely-used, well-known,\n    and has a huge set of compatible middleware.\n  </p>\n  <p>\n    But we don't lock people in a single paradigm. We let them use whatever they need. Fastify is a better choice when\n    you care about really good performance, that's why we provide a built-in <code>FastifyAdapter</code> that helps to\n    integrate this library with Nest.\n  </p>\n  <h4>Installation</h4>\n  <p>\n    Firstly, we need to install required packages:\n  </p>\n  <pre><code class=\"language-bash\">{{ packages }}</code></pre>\n  <h4>Adapter</h4>\n  <p>\n    Once fastify is installed, we can use a <code>FastifyAdapter</code>.\n  </p>\n  <pre><code class=\"language-typescript\">{{ bootstrap }}</code></pre>\n  If you're running your Nest instance inside of a <strong>docker container</strong> you will need to specify the host,\n  like so:\n  <pre><code class=\"language-typescript\">{{ docker }}</code></pre>\n  <p>\n    And that's all. Also, you are able to pass options into fastify constructor through <code>FastifyAdapter</code>\n    constructor.\n    Keep in mind that now, Nest uses fastify as an <strong>HTTP provider</strong>, meaning, each recipe that relays on\n    express won't work anymore. You should rather use fastify equivalent packages.\n  </p>\n  <p>\n    A working example is available <a href=\"https://github.com/nestjs/nest/tree/master/sample/10-fastify\">here</a>.\n  </p>\n</div>\n"

